import React ,{Component}from 'react';
import { Text,  View,TouchableOpacity,SafeAreaView } from 'react-native';
import {styles} from '../providerStyle';
import I18n from '../switchLanguage';
export default class Finish extends Component {
  constructor(props) {
    super(props);
    this.state={
      name:'',
    }
  }
  componentDidMount(){
    this.setState({name:this.props.route.params.name});
  }
  render() {
  return (
    <SafeAreaView style={{ flex:1, alignItems: "center",justifyContent:'center'}}>
      <Text style={{ fontSize:24, fontWeight: '500', color: '#68B0AB' }}>{this.state.name} {I18n.t('ftitle')} </Text>
      <Text style={{ fontSize:20, fontWeight: '400' }}>{I18n.t('fstitle')} </Text>
      <Text style={{ fontSize:20, fontWeight: '400' }}>{I18n.t('fsend')} {this.state.name}</Text>
      <Text style={{ fontSize:20, fontWeight: '400' }}>{I18n.t('fafter')}</Text>
      <TouchableOpacity
        style={{
          width: '30%',
          height: 40,
          backgroundColor: '#68B0AB',
          borderRadius: 20,
          alignItems: 'center',
          justifyContent: "center"}}
      onPress={() => {this.props.navigation.navigate('预约')}}>
        <Text style={{ fontSize:16, fontWeight: '400', color: '#ffffff' }}>{I18n.t('btf')}</Text>
      </TouchableOpacity>
    </SafeAreaView>
  )}
}
